import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const initialCourses = [
    { 
      id: "linux", title: "Linux Admin", price: "55,000 MMK", duration: "2 Months", 
      req: "Basic Computer", vidId: "yv_vPAtE_kQ",
      img: "https://images.unsplash.com/photo-1629654297299-c8506221ca97?q=80&w=1000", 
      detail: "Master Linux CLI, Server Management, and Security Auditing for enterprise environments." 
    },
    { 
      id: "cyber", title: "Cyber Security", price: "75,000 MMK", duration: "3 Months", 
      req: "Network Basics", vidId: "Z3_6qJ0pGno",
      img: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b?q=80&w=1000", 
      detail: "Learn Threat Hunting, SOC Analysis, and Incident Response to become a security analyst." 
    },
    { 
      id: "net", title: "Networking", price: "45,000 MMK", duration: "2 Months", 
      req: "None", vidId: "09Z_yK_hS3k",
      img: "https://images.unsplash.com/photo-1544197150-b99a580bb7a8?q=80&w=1000", 
      detail: "Deep dive into CCNA level Networking, Protocols, and Hardware configuration." 
    },
    { 
      id: "py_basic", title: "Python Basic", price: "40,000 MMK", duration: "1.5 Months", 
      req: "Logical Thinking", vidId: "mX4Z0D_vL_A",
      img: "https://images.unsplash.com/photo-1526374965328-7f61d4dc18c5?q=80&w=1000", 
      detail: "Fundamentals of Programming, Automation, and Scripting with Python 3." 
    }
  ];

  const [courses, setCourses] = useState(initialCourses);
  const [selectedCourse, setSelectedCourse] = useState(null);

  const handleNext = () => {
    const newItems = [...courses];
    newItems.push(newItems.shift());
    setCourses(newItems);
  };

  const handlePrev = () => {
    const newItems = [...courses];
    newItems.unshift(newItems.pop());
    setCourses(newItems);
  };

  return (
    <div style={styles.body}>
      {/* Top Navbar */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0, letterSpacing: '2px' }}>2 CYBER_SHIELD</h2>
        <div style={styles.navRight}>
          <Link to="/login" style={styles.loginBtn}>LOGIN</Link>
          <Link to="/register" style={styles.regBtn}>REGISTER</Link>
          <Link to="/register" style={styles.joinBtn}>JOIN</Link>
        </div>
      </nav>

      {/* Slider Section */}
      <div style={styles.sliderContainer}>
        <div style={styles.slide}>
          {courses.map((course, index) => (
            <div 
              key={course.id}
              onClick={() => index >= 2 && handleNext()}
              style={{
                ...styles.item,
                backgroundImage: `url(${course.img})`,
                width: index < 2 ? '100%' : '180px',
                height: index < 2 ? '100%' : '260px',
                left: index < 2 ? '0' : `calc(50% + ${(index - 2) * 200}px)`,
                top: index < 2 ? '0' : '60%',
                opacity: index >= 5 ? 0 : 1,
                zIndex: index < 2 ? 1 : 10,
                borderRadius: index < 2 ? '0' : '15px',
                boxShadow: index < 2 ? 'none' : '0 20px 40px rgba(0,0,0,0.6)'
              }}
            >
              {index === 1 && (
                <div style={styles.content}>
                  <div style={styles.name}>{course.title}</div>
                  <div style={styles.des}>{course.detail}</div>
                  <button style={styles.missionBtn} onClick={(e) => { e.stopPropagation(); setSelectedCourse(course); }}>
                    MISSION BRIEFING
                  </button>
                </div>
              )}
            </div>
          ))}
        </div>

        <div style={styles.buttonContainer}>
          <button style={styles.navBtn} onClick={handlePrev}>‚ùÆ</button>
          <button style={styles.navBtn} onClick={handleNext}>‚ùØ</button>
        </div>
      </div>

      {/* Expanded Video Modal */}
      {selectedCourse && (
        <div style={styles.modalOverlay} onClick={() => setSelectedCourse(null)}>
          <div style={styles.modalContent} onClick={e => e.stopPropagation()}>
            <div style={styles.modalHeader}>Mission: with Video</div>

            <div style={styles.modalMain}>
              <h2 style={styles.modalTitle}>[ MISSION: {selectedCourse.title} ]</h2>

              <div style={styles.flexContainer}>
                {/* Left: Video */}
                <div style={styles.videoWrapper}>
                  <iframe 
                    width="100%" height="220" 
                    src={`https://www.youtube.com/embed/${selectedCourse.vidId}`} 
                    title="YouTube video" frameBorder="0" allowFullScreen
                    style={{ borderRadius: '8px', border: '1px solid #233554' }}
                  ></iframe>
                </div>

                {/* Right: Info Tags */}
                <div style={styles.infoTags}>
                  <div style={styles.tag}><span style={styles.icon}>üí∞</span> Price: {selectedCourse.price}</div>
                  <div style={styles.tag}><span style={styles.icon}>‚è≥</span> Duration: {selectedCourse.duration}</div>
                  <div style={styles.tag}><span style={styles.icon}>üîë</span> Req: {selectedCourse.req}</div>
                  <div style={styles.tag}><span style={styles.icon}>üõ°Ô∏è</span> Status: Active</div>
                </div>
              </div>

              <p style={styles.modalDetail}>{selectedCourse.detail}</p>

              <div style={styles.modalFooter}>
                <Link to="/register" style={styles.enrollBtn}>ENROLL MISSION</Link>
                <button style={styles.abortBtn} onClick={() => setSelectedCourse(null)}>ABORT</button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

const styles = {
  body: { backgroundColor: '#1a1d23', height: '100vh', overflow: 'hidden', fontFamily: '"Segoe UI", Roboto, sans-serif' },
  nav: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '15px 50px', background: '#1c1f26', position: 'fixed', width: '100%', boxSizing: 'border-box', zIndex: 1000 },
  navRight: { display: 'flex', gap: '10px' },
  loginBtn: { color: '#ccd6f6', textDecoration: 'none', border: '1px solid #444', padding: '6px 15px', borderRadius: '4px', fontSize: '12px' },
  regBtn: { color: '#ccd6f6', textDecoration: 'none', border: '1px solid #444', padding: '6px 15px', borderRadius: '4px', fontSize: '12px' },
  joinBtn: { background: '#a7f3d0', color: '#064e3b', textDecoration: 'none', padding: '6px 20px', borderRadius: '4px', fontWeight: 'bold', fontSize: '12px' },

